import React, { useEffect, useState, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../partials/Header';
const UserDashboard=()=>{
    const [user, setuser] = useState(null);
    const navigate = useNavigate();
    const [userbookings,setuserbooking]=useState(null);
    useEffect(() => {
        const checkSessions = async () => {

            try {
                const userResponse = await fetch('http://localhost:5000/user/checksession', {
                    credentials: 'include'
                });

                if (userResponse.ok) {
                    const data = await userResponse.json();
                    setuser(data);
                } else {
                    setUsername(null);
                } 
                const userbookings=await fetch('http://localhost:5000/user/userbookings',{
                    credentials: 'include'
                });
                if(userbookings.ok){
                    const bookdata=await userbookings.json();
                    setuserbooking(bookdata);
                }

            } catch (error) {
                console.error('Error checking sessions:', error);
            }
        };

        checkSessions();
    }, [navigate]); 
    return(
        <div>
            <Header />
            </div>)
};
export default UserDashboard;
